import React from 'react';

const Contact = () => {
    return (
        <div className="contact-container">
            <h1>Контакти</h1>
            <p>Зв'яжіться з нами для отримання додаткової інформації.</p>
            <button className="button">Написати нам</button>
        </div>
    );
};

export default Contact;
